import { Container, ImgHolder, ImageProject, ProjectTitle, TechUsed, SourCode } from "./ProjectStyles";

function Project({href,ImgURL, title, tech, link}) {
    return (
        <Container href={link}>
            <ImgHolder>
                <ImageProject src={ImgURL} alt="ProjectImg"/>
            </ImgHolder>
            <ProjectTitle>{title}</ProjectTitle>
            <TechUsed>{tech}</TechUsed>
            <SourCode>{link}</SourCode>
        </Container>
    )
}

export default Project;
